(59, 106, 0, NULL, 292, 'Александров Дмитрий', ' В современном жилом комплексе в 5 минутах езды от метро Юго западная, на первом этаже нового, современного, 24 этажного дома , предлагается под залог 2 коммерческих помещения на первом этаже и в полуподвале. Для этих двух помещений уже есть арендаторы, которые в настоящий момент осуществляют  ремонт помещений под коммерческую деятельность. Отдельный вход, большие окна. Рядом несколько 24 этажных высоток и большой спортивный центр прямо во дворе комплекса. Идеальное место для любой коммерческой деятельности с большим потенциалом. Рыночная стоимость объекта - 30 000 000 рублей. Требуемая сумма к выдаче - 15 000 000. По оценке Национального кредитного союза данный объект имеет отличные залогово - инвестиционные перспективы.', '2018-11-19 14:54:24', '59.'),
(60, 129, 0, NULL, 90, 'БАРАНОВ ВИТАЛИЙ', 'прописан 9 лет внук и женщина 1933 года.', '2018-12-05 14:56:32', '60.'),
