(45, 2, 1, 'Обносова Г.Б.', '<p><span style=\"color:rgb(0, 0, 0); font-family:arial,sans-serif; font-size:15px\">Клиенту нужны деньги до продажи дома, желаемая сумма 15млн, но согласится и на меньшее.</span></p>\r\n', 12, '15000000.00', 'Московская область, Люберецкий район, д.Кирилловка, квартал 1, д.9', 'Московская область, Люберецкий район, д.Кирилловка, квартал 1, д.9', 7, 'Договор купли-продажи', 11846771, 22475000, 20227500, 17193375, 2, 1538575242, 1538577690, NULL, 47, 27, 1, 2, 6000000, '362.5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(46, 2, 1, 'МУТАЛИБ-заде Эльдар Намикович/ Виктор', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1590px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">Стильная загородная резиденция расположена на западе Московской области в Одинцовском&nbsp; районе, в 3-х км ст Ромашково, Беларусской железной дороги, в 1-ом км ст Немчиновка, Беларусской железной дороги и&nbsp; 3,4 км от МКАД.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Объект состоит из 3-х участков, общей площадью 40 соток.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Огорожен мощным бетонным забором, высотой 2,7 м, на бетонном ленточном фундаменте глубиной 1,8 м. Забор оштукатурен, ,отделан&nbsp;&nbsp; камнем, бамбуком, деревом.Забор отделан колпаками, отливами и крышками ручной работы.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; На участок имеются три въезда, оборудованные автоматическими воротами.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Дизайн всей резиденции выполнен в прованс&nbsp; стиле. Используемый материалы -&nbsp; натуральный камень,дерево, клиринговый кирпич.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Коммуникации &quot;: сеть автоматического полива, дренажная система, электрика, газ природный, вода / городская плюс&nbsp; артезианская скважина /, охранная сигнализация&nbsp; / по контуру 20 видеокамер /., освещение / 60фонарей /.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Территория : площадки, дорожки,выложенные брусчаткой.&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Зеленые насаждения : ухоженный газон , посадки деревьев хвойных , лиственничных пород, цветники и пр.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ПОСТРОЙКИ&nbsp;: Дом, хозяйственый блок,&nbsp; вольер для собак</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">ДОМ&nbsp;&nbsp;&nbsp;- 3 этажа 774,5 м2</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">ЦОКОЛЬНЫЙ ЭТАЖ&nbsp;- помещения для размещения производственного оборудования : котлы, накопительные баки для бассейна и полива, оборудование для очистки бассейна, оборудование для охранной сигнализации&nbsp; ; прачечная , винный склад,холлы,&nbsp; сауна, с/узлы, душевые, спортивный зал, бассейн, зимный сад.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">1 ЭТАЖ&nbsp;&nbsp; -&nbsp;Холлы, гардеробная, диванная зона для отдыха, камин, 3 с/узла, столовая , 2 кухни, две гостевые комнаты</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">2 ЭТАЖ&nbsp; - 4спальни, холлы, 3 с/узла, гардеробные, кабинет, игровая</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">3 ЭТАЖ&nbsp;- спальня с/узел</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">Все помещения выполнены с высоким уровнем отделки, дорогостоящими материалами.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">Встроенный пылесос.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">Дом&nbsp; &quot;охвачен круговой террассой, выложенной доской.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">ХОЗ БЛОК: складское помещение, система венциляции, кондиционерования и дизельный генератор.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">ЦОКОЛЬНЫЙ ЭТАЖ&nbsp;- помещения для размещения производственного оборудования (котельня, серверная, система очистки воды в том числе дистиялции, сиситема увлажнения), крупногабаритной малой техники, спорт зал, киноатеатр, с/узел. Душевая, кладовые комнаты</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">помещения для размещения производственного оборудования ,&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">ГАРАЖ: на 3 машиноместа, складское помещение, санузел</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:24px\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:24px; width:964px\">Все помещения выполнены с высоким уровнем отделки, дорогостоящими материалами.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 0, '60000000.00', 'одинцовский район село ромашково ул. раздоровская 30', 'одинцовский район село ромашково ул. раздоровская 30', 15, '22.04.2016. разрешение на ввод в эксплуатацию', 25460905, 154800000, 139320000, 118422000, 2, 1538606917, 1539519125, NULL, 55, 27, 12, 1, 30000000, '774.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(47, 1, 1, 'НЕМАКОВА С.И. (смирнов)', '<ul>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Нас. пункт:</span>&nbsp;<strong>Домодедово</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Типовая серия:</span>&nbsp;<strong>индивидуальный проект</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Год постройки:</span>&nbsp;<strong>2001</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Перекрытия:</span>&nbsp;<strong>железобетонные</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Каркас:</span>&nbsp;<strong>Кирпичный</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Стены:</span>&nbsp;<strong>Из прочих материалов</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Класс энергоэффективности:</span>&nbsp;<strong>E</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Износ дома:</span>&nbsp;<strong>16.00%</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Назначение:</span>&nbsp;<strong>Жилой дом&nbsp;</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Тип дома:</span>&nbsp;<strong>Многоквартирный дом</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Квартир:</span>&nbsp;<strong>160</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Проживает:</span>&nbsp;<strong>349 человек</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Этажей всего:</span>&nbsp;<strong>10</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Подъездов:</span>&nbsp;<strong>2</strong></li>\r\n	<li style=\"text-align:left\"><span style=\"color:rgb(90, 141, 113)\">Лифтов в подъезде:</span>&nbsp;<strong>1</str