(68, 2, 1, 'Ковтунова (Виталий)', '<p><em>Паспорт собственника во вложении, заемщиком будет выступать другой человек, свой паспорт он только на встрече покажет.</em></p>\r\n\r\n<p><em>ДКП только на встрече покажут оригинал.</em></p>\r\n\r\n<p><em>Поселок Нахабино, коттедж 430м2, 4 уровня,кирпич, перекрытия ж/б,кровля металлочерепица</em><br />\r\n<em>1. Цоколь: сауна,комната отдыха, бильярдная,с/у,бойлерная, комната для персонала</em><br />\r\n<em>2. 1 этаж- прихожая, кухня столовая, гостиная с камином,спальня, с/у, гараж на 2 авто</em><br />\r\n<em>3. 2 этаж- кабинет, 5 спален,с/у, гардеробная,спорт зал</em><br />\r\n<em>4. Мансарда - кинозал</em><br />\r\n<em>Доп строения: баня , на участке бассейн с подогревом, барбекю, вольер для собаки</em><br />\r\n<em>Эл-во, газ, центральные коммуникации, сигнализация, кондиционирование и тд.</em><br />\r\n<em>Деревья , газоны, участок 15 соток</em></p>\r\n', 18, '25000000.00', 'Московская область, Красногорский район, НСТ \"Речное\", бр.17а, уч.7', 'Московская область, Красногорский район, НСТ \"Речное\", бр.17а, уч.7', 10, '', 6560794, 38650000, 34780000, 29560000, 2, 1539700625, 1539761693, NULL, 57, 27, 1, 1, 10000000, '431.0', NULL, 2, 1, NULL, NULL, NULL, NULL, NULL),
