(83, 3, 1, 'Полунина (Виктор)', '<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Клиент запрашивает под залог 7.0 млн.р</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Объект, не завершенное строительство ТЦ.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Изначально покупался по договору купли-продажи за 20 млн.р с площадью в 277 кв.м.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">В данный момент объект готов на 90 %, имеет площадь 555 кв.м + 100 подвальное помещение.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Аренда земельного участка 6 соток. Планируют его выкупать после ввода в эксплуатацию данного здания по остаточной цене.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">По прогнозам собственника данное строение будет завершено и введено в эксплуатацию до конца данного года.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Планируется заключение договора аренды площадей для организации магазина Торговой сети &quot; Магнит &quot; От них уже есть предварительное соглашение.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Свет, вода, отопление, центральные. Все готово, осталось только запустить.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">1-соб</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">КИ- хор</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">ФССП-чисто</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">По оценке 30.0 млн.р</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Цель займа -&nbsp;в строительство данного объекта.</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">Займ требуется на короткий срок не более чем 6 мес.</div>\r\n', 0, '7000000.00', 'Московская область, г Серпухов, ул Новая', 'Московская область, г Серпухов, ул Новая', NULL, 'Договор купли-продажи', 1754632, 13000000, 11730000, 9970690, 2, 1540980616, 1540981331, NULL, 25, 27, 6, 1, 3320500, '454.0', 134, 1, 1, NULL, NULL, NULL, NULL, NULL),
