(93, 2, 1, 'Хадарцев/Рошка', '<p><em>Смотрите ко всеем этим документам , будут предоставлены следующие документы , а именно :</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>Свежие выписки с гос. реестра , о том что на этот дом , сняты все обременения . срок исполн. 08.11.18.</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>В этот же день , будет подписан и передан на регистрацию в рег. палату высланный в Ваш адрес ДКП , а так же акт .</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>Свидетельства о переходе прав собственности на моё имя , будут в реестре 16.11.18г.</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>Исходя из этих обстоятельств , прошу Вас согласовать все по этапные процедуры , которые мне необходимо исполнить .</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>Мой пожелания , остаются по прежнему , получить заём , не меньше 40 млн. руб.</em><br />\r\n<em>&nbsp;</em><br />\r\n<em>Орентировочная оценка 70 - 75 руб.</em><br />\r\n<em>&nbsp;</em><br />\r\n&nbsp;</p>\r\n', 17, '40000000.00', 'Московская область, Мытищинский р-н, д Юдино, ул Колхозная, д 27', 'Московская область, Мытищинский р-н, д Юдино, ул Колхозная, д 27', 10, 'Договор купли-продажи', 28065719, 40800000, 36720000, 31212000, 2, 1541584820, 1541680191, NULL, 48, 27, 12, 1, 10400000, '544.0', NULL, 4, 1, 288, NULL, NULL, NULL, NULL),
