(111, 2, 1, 'Илюшина Наталия Валентиновна', '<p><span style=\"color:rgb(0, 0, 0); font-family:arial,sans-serif; font-size:15px\">дом из сруба обшит кирпичом,фундамент бетон,</span></p>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">\r\n<div>2 собственника совершеннолетние(оба согласны)</div>\r\n\r\n<div>прописаны 2е несовершеннолетних+1 собственник</div>\r\n\r\n<div>по коммуникациям :</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Газ-балон</div>\r\n\r\n<div>канализация-выгребная яма</div>\r\n\r\n<div>свет-центральный</div>\r\n\r\n<div>водоснабжение-скважина</div>\r\n</div>\r\n', 16, '1000000.00', 'Московская область, г. Балашиха, ш. Щелковское, 187Б', 'Московская область, г. Балашиха, ш. Щелковское, 187Б', 5, 'Договор купли-продажи от апреля 2017 года', 2679624, 9960000, 8960000, 7620000, 2, 1542358609, 1542792932, NULL, 21, 27, 12, 1, 2900000, '155.5', 9, 1, 1, 299, NULL, NULL, NULL, NULL),
(112, 1, 1, 'ГАЛАЕВА Изабелла дж', '<h3>Расположение, транспортная доступность</h3>\r\n\r\n<p><span style=\"background-color:rgb(244, 244, 244); color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:14px\">Московский жилой комплекс &laquo;Дом на Бурденко&raquo; (также известный как &laquo;Скуратов Хаус&raquo;) возведен в престижном районе Хамовники, неподалеку от крупной зеленой зоны &ndash; сквера Девичьего поля. Элитная новостройка располагается по соседству с театрами, балетом, известными столичными картинными галереями, что обеспечивает жителям дома на Бурденко разнообразный досуг на самый взыскательный вкус. Важное преимущество &laquo;Дома на Бурденко&raquo; перед многими центральными новостройками &ndash; его отличная транспортная доступность. В первую очередь следует отметить малое расстояние до Садового кольца: ближайший крупный выезд находится на Зубовском бульваре, в 300 метрах от новостройки. Жителям &laquo;Дома на Бурденко&raquo; будет удобно воспользоваться и другими оживленными магистралями столицы &ndash; например, Смоленской улицей, Ростовской набережной. Выезд на Кутузовский проспект &ndash; в полутора километрах от дома. Что касается общественного транспорта, &laquo;Дом на Бурденко&raquo; удален примерно на километр от станций метро &laquo;Смоленская&raquo;, &laquo;Парк Культуры&raquo; &ndash; пешком можно дойти за 15-20 минут, доехать на автобусе &ndash; за пять минут. Автобусные остановки есть на Зубовской улице &ndash; в 200 метрах от новостройки. Район между Плющихой и Садовым кольцом, где построен &laquo;Дом на Бурденко&raquo;, можно назвать одним из самых благоприятных для жизни в центре Москвы. Окна клубного дома выходят на улицу Бурденко (с односторонним движением) и в уютный внутренний двор, от других дорог новостройка закрыта соседними домами. Поблизости нет промзон, поэтому единственным источником загрязнения воздуха являются выхлопные газы. При этом в элитной новостройке предусмотрены передовые инженерные системы, в том числе вентиляции и кондиционирования, что позволяет обеспечить жителям дома тишину и свежий воздух в квартирах.</span></p>\r\n\r\n<h3>Инфраструктура</h3>\r\n\r\n<p><span style=\"background-color:rgb(244, 244, 244); color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:14px\">На внутренней территории клубного дома раскинулся небольшой зеленый сад с площадкой для детских игр, скамейками для отдыха и декоративным фонтаном. В состав жилого комплекса входят две секции &ndash; 5 и 11 этажей. На крыше первой секции оборудована еще одна зона отдыха, где все жители дома могут полюбоваться цветниками или панорамными видами города, пообщаться, приготовить барбекю. Терраса на крыше снабжена стеклянным ограждением. Автомобилистов, проживающих в элитной новостройке, порадует наличие подземного паркинга, который готов принять больше сотни машин &ndash; по три на каждую квартиру. На въезде оборудована тепловая завеса. Инфраструктура дома также включает офисы, кафе и зону ресепшн; все эти объекты расположены на первом этаже. Особое внимание застройщик клубного дома уделил вопросам безопасности. Территория новостройки огорожена, собственная служба охраны работает круглосуточно. Во дворе и на этажах ведется видеонаблюдение, вход осуществляется по специальным электронным картам. Все общественные зоны адаптированы для маломобильных групп населения. В ближайших кварталах действуют школы и лицеи, детские сады, музеи, театры, торговые комплексы, поликлиника и частные клиники.&nbsp;</span></p>\r\n\r\n<h3>Надежность застройщика</h3>\r\n\r\n<p><span style=\"background-color:rgb(244, 244, 244); color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:14px\">Новостройка на улице Бурденко успешно сдана в 2012 году. Проект клубного дома был разработан известным архитектором Сергеем Скуратовым. Застройщиком жилого комплекса выступила компания &laquo;Новый дом &ndash; 94&raquo;. Данная организация основана в 1997 году, но единственным объектом недвижимости в ее портфеле остается &laquo;Дом на Бурденко&raquo;.</span></p>\r\n\r\n<h3>Архитектура</h3>\r\n\r\n<p><span style=\"background-color:rgb(244, 244, 244); color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:14px\">Элитный клубный дом состоит из двух корпусов высотой 5 и 11 этажей. Стены облицованы коричневым клинкерным кирпичом, который славится прочностью, водонепроницаемостью и устойчивостью к низким температурам. Вниманию покупателей предложены 33 квартиры, на одном этаже живут не более двух-трех семей. Самые большие квартиры &ndash; пятикомнатные (до 230 квадратных метров), наименьшие &ndash; двухкомнатные (от 110 квадратных метров). Высота потолков более 3 метров, а на последнем этаже &ndash; около 5 метров. Проектом предусмотрены новейшие инженерные технологии очистки воздуха, использование альтернативных источников электроэнергии.</span></p>\r\n', 0, '92000000.00', 'г. Москва, Бурденко д.3', 'г. Москва, Бурденко д.3', 9, 'ДКП 2015', 7732426, 188500000, 169666000, 152700000, 2, 1542633044, 1542633898, NULL, 14, 27, 11, 1, 59300000, '230.0', 1, 1, 1, 298, NULL, NULL, NULL, NULL),
(113, 2, 0, 'ТИМИРГАЛИЕВ', '<p>Участок 479 кв.м. с домом(под снос) в Раменском районе по адресу: д. Дергаево, ул. Центральная.<br />\r\n&nbsp;Дом 1-этажный, площадь - 54.5 кв.м., и 2-х этажный кирпичный гараж площадью 85 кв.м. с жилым помещением на втором этаже. Категория земель - земли населенных пунктов, разрешенное использование - для ведение личного подсобного хозяйства. Коммуникации : магистральный газ в доме, электричество 15 квт, вода - колодец во дворе. Есть колодец под септик. По участку проходит дренажная система. Участок огорожен забором - дерево. Дорога к участку асфальтированная. Дом и земля оформлены в собственность с 2012 г., все документы в наличии. Удачное местоположение обьекта: находится в черте города, вся необходимая инфраструктура в шаговой доступности - сетевые магазины, строительный рынок, школа, автобусная остановка и т.д.<br />\r\n&nbsp;Удобное транспортное сообщение с Москвой .</p>\r\n\r\n<p>&nbsp;</p>\r\n', 36, '0.00', '', '', 3, '', NULL, NULL, NULL, NULL, 2, 1542647180, 1542804518, NULL, 58, 36, 11, 1, NULL, '54.5', NULL, 4, 1, 295, NULL, NULL, NULL, NULL),
(115, 3, 1, 'ООО Совершенно секретно тренд', '<p>Необходимо 200 000 000 рублей, можно и больше. Для развития бизнеса.</p>\r\n', 0, '300000000.00', 'Композиторская улица, 17 Москва, Россия, 121099', 'Композиторская улица, 17 Москва, Россия, 121099', NULL, 'акт от 2006 года', 66163073, 785185843, 706667258, 600667170, 2, 1542717057, 1542792912, NULL, 13, 27, 12, 1, 350000000, '3012.9', 1, 1, 1, 294, NULL, NULL, NULL, NULL),
(116, 2, 1, 'ХОЛИНА', '<p><span style=\"color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:16px\">Предлагается Вашему вниманию коттедж в закрытом и охраняемом комплексе &quot;Южное-Голицино&quot;. Поселок расположен рядом с знаменитым Оздоровительным Комплексом &quot; Дагомыс&quot;. Прекрасное, тихое и уютное место, для комфортного загородного проживания. На территории комплекса, имеется общий большой бассейн, с детской площадкой, кафе и зоной барбекю. Свой Теннисный Корт. С отдельным спуском к морю, до которого всего 250 метров. Сам дом, расположен таким образом, что из всех балконов и эксплуатируемой кровли, открывается панорамный вид на море, горы и солнечный Дагомыс. Очень грамотно, составлена планировка самого дома. На первом этаже,просторная входная группа, с зоной отдыха. На втором этаже, расположены, большой зал с камином, кухня, спальная комната с санузлом, и большой балкон. В доме 5-санузлов, и пять спальных комнат. На третьем этаже, расположены три спальные комнаты санузлами и также просторный балкон. И наконец выход на четвертый этаж, эксплуатируемая кровля, где расположена огромная терраса с прекрасными видовыми характеристиками на море и горы. На участке с ландшафтным дизайном располагается летняя беседка, растут фруктовые деревья и разные вечнозеленые насаждения. Дом полностью обставлен мебелью от ведущих итальянских производителей, и оснащен всей необходимой бытовой техникой и аппаратурой</span></p>\r\n', 0, '0.00', 'г. Сочи, поселок Дагомыс, переулок Южно-Голицынский д.11', 'г. Сочи, поселок Дагомыс, переулок Южно-Голицынский д.11', 10, 'разрешение на ввод 2007г', 0, 28480000, 25630000, 21800000, 2, 1542800705, 1542805362, NULL, 11, 30, 11, 1, 10900000, '339.1', 1067, 1, 31, 284, NULL, NULL, NULL, NULL),
