(124, 1, 0, 'БАРАНОВСКИЙ В.И.', '<p><span style=\"color:rgb(18, 18, 18); font-family:lato,sans-serif; font-size:16px\">квартира в самом экологически чистом районе Москвы в 5 минутах ходьбы от метро. В пешей доступности расположены все необходимые магазины, включая крупные ТЦ (Вива, Карусель), медицинские учереждения как частные, так и государственные (детская поликлиника в трех минутах ходьбы), кинотеатр (в ТЦ Северное Сияние), различные спортивные клубы и секции, 3 школы и 7 детских садов, огромный обустроенный парк с прудами и многое другое! Сама квартира находится в благоприятном, удалённом от дорог тихом месте. Квартира тёплая. Окна выходят в две стороны: воне двор и на общую панораму района. ПЕРЕПЛАНИРОВОК НЕТ! Два санузла: в одном ванная, в другом душевая. 2 застеклённые лоджии, есть гардеробная и большая кладовка. Всего на каждом этаже по три квартиры и это на 2 лифта! Есть консъерж и специально оборудованные места для колясок, лыж,велосипедов.</span></p>\r\n', 0, '5000000.00', 'г. Москва, ул. Грина д.40, к.1', 'г. Москва, ул. Грина д.40, к.1', 2, '2002', 0, 9900000, 8910000, 8019000, 2, 1543570826, 1544104896, NULL, 54, 27, 11, 1, 4500000, '58.4', 1, 1, 1, 284, NULL, NULL, NULL, NULL),
(125, 1, 0, 'БАРАНОВСКАЯ Е.В.', '<p><span style=\"color:rgb(18, 18, 18); font-family:lato,sans-serif; font-size:16px\">дом 2013 месторасположение:близко к центру,пешком до 3 станций метро,экологически чистый и престижный Юго-западный округ,лучшие ВУЗы,школы,лицеи,солидные соседи .Воронцовский парк и Воробьевы горы. Монолитный дом 2013 г.,консьерж,просторная входная группа и коридоры. Первый собственник, полная стоимость,простая альтернатива.Парковка наземная и подземная.</span></p>\r\n', 0, '5000000.00', 'г. Москва, ул. Панферова д.4', 'г. Москва, ул. Панферова д.4', 1, 'Договор дарения 27.12.2017', 10442698, 9200000, 8300000, 7500000, 2, 1543573351, 1544104881, NULL, 56, 27, 11, 1, 4100000, '38.6', 1, 1, 1, 284, NULL, NULL, NULL, NULL),
(126, 3, 1, 'ООО Прима плюс', '<p>&nbsp;</p>\r\n\r\n<div><span style=\"color:rgb(0, 0, 0); font-family:arial,sans-serif; font-size:15px\">Предлагается к залогу офисное помещение в бизнес центре&nbsp;440 кв. метров </span><span style=\"color:rgb(34, 34, 204); font-family:arial,sans-serif; font-size:15px\">по адресу Проспект Мира дом 102, корп.1. Современное здание, офисное помещение с</span><span style=\"color:rgb(0, 0, 0); font-family:arial,sans-serif; font-size:15px\">дается в с долгосрочную аренду, 4-ре арендатора, суммарное поступление от аренды около 700 тысяч в месяц (поступления отражены в отчетности), коммунальные расходы около 150 тысяч и налоги на имущество и другие налоги, земля под зданием оформлена,&nbsp;земельные вопросы управляющая компания &quot;Импульс Технопарк&quot; </span><span style=\"color:rgb(0, 0, 0); font-family:arial,sans-serif; font-size:15px\">&nbsp;Нужно 30 млн.рублей. Клиент готов на оформление залога по ДКП.</span></div>\r\n\r\n<div>&nbsp;</div>\r\n', 0, '30000000.00', 'города Москва, проспект Мира 102 корпус 1', 'города Москва, проспект Мира 102 корпус 1', NULL, 'ДКП от 24.04.2018 года', 42460000, 82720000, 65340000, 55539000, 2, 1543840652, 1544691538, NULL, 2, 27, 12, 1, 27769500, '440.0', 1, 1, 1, 294, NULL, NULL, NULL, NULL),
(127, 3, 1, 'Хныкина', '<div style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15px;\">\r\n<div id=\"style_15438257930000000328_BODY_mailru_css_attribute_postfixfb5114b3730917ff180b963755558fdc\">\r\n<p>В залог предлагается отдельно стоящее коммерческое помещение в Лыткарино М.О., сдаваемое в аренду &nbsp;стоимостью примерно 31 млн руб. Цель кредита участие в тендерах .&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n', 19, '17000000.00', 'Московская область, г. Лыткарино, микрорайон № 5, квартал 1, строен 4а', 'Московская область, г. Лыткарино, микрорайон № 5, квартал 1, строен 4а', NULL, 'ДКП 2015 года', 2796406, 17000000, 15300000, 13000000, 2, 1543849267, 1543849742, NULL, 1, 27, 12, 1, 7650000, '338.0', 86, 1, 1, 309, NULL, NULL, NULL, NULL),
(129, 1, 0, 'Яшечкина', '<p><span style=\"background-color:rgb(238, 249, 255); color:rgb(18, 18, 18); font-family:lato,arial,sans-serif; font-size:14px\">Квартира в нормальном&nbsp;состоянии. Распашонка. Светлая и уютная. Комнаты изолированные. С/у - раздельный. Балкон c комнаты, застеклен и утеплен. Стеклопакеты. Большой холл. Дом расположен в зеленом, тихом районе с развитой инфраструктурой. До м. &quot;Теплый стан&quot; 20 мин.транспортом.&nbsp;</span></p>\r\n', 24, '0.00', 'Москва, Десеновское п, улица Дмитрия Рябинкина, д 2/2, кв 37', 'Москва, Десеновское п, улица Дмитрия Рябинкина, д 2/2, кв 37', 2, 'ДКП 2017 г.', 5195125, 4914000, 4422600, 3759210, 2, 1544003342, 1544105126, NULL, 52, 27, 12, 1, 2211300, '54.6', NULL, 2, 1, 284, NULL, NULL, NULL, NULL),
(130, 1, 0, ' Кузумова Айна', '<p>В залог предлагается 3 комнатная квартира. Современный дом в непосредственной близости от метро Воробьевы горы.</p>\r\n\r\n<p>Ограничения:</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"color:rgb(52, 52, 52); font-family:arial; font-size:12px; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>№ 77:06:0001002:4294-77/012/2017-1 &nbsp;от&nbsp;02.11.2017 &nbsp;(Запрещение сделок с имуществом)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>№ 77-77/006-77/006/235/2016-1338/1 &nbsp;от&nbsp;06.05.2016 &nbsp;(Ипотека)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>№ 77:06:0001002:4294-77/012/2018-2 &nbsp;от&nbsp;29.08.2018 &nbsp;(Запрещение сделок с имуществом)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 0, '0.00', 'Москва, ул Косыгина, д 5, кв 292', 'Москва, ул Косыгина, д 5, кв 292', 3, 'ДКП 15.11.2012', 17639811, 17800000, 16000000, 13600000, 2, 1544454478, 1544457421, NULL, 0, 27, 12, 1, 8000000, '70.9', 1, 1, 1, 317, NULL, NULL, NULL, NULL),
(131, 3, 1, 'ГУДИМОВ', '<p>действующий бизнес</p>\r\n\r\n<p>доходс аренды</p>\r\n', 0, '6000000.00', 'Варшавское шоссе д.8, корп.10', 'Варшавское шоссе д.8, корп.10', NULL, '02.04.2018', 3689754, 17248000, 15500000, 13970000, 2, 1545143062, 1545143062, NULL, 0, 27, 11, 1, 7700000, '78.4', 1, 1, 1, 321, NULL, NULL, NULL, NULL),
(132, 1, 1, 'КАРИМОВА', '<p>Прописано 3 взрослых.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, '17000000.00', 'переулок Петровский д.5 стр.2', 'переулок Петровский д.5 стр.2', 7, 'Договор дарения 26.09.2018', 100144731, 71580000, 64400000, 57980000, 2, 1545321131, 1545321131, NULL, 0, 27, 11, 1, 32200000, '148.2', 1, 1, 1, 284, NULL, NULL, NULL, NULL),
